// src/pages/CadastroAdmin.js

import React from 'react';
import { Container, Button, Form } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import '../styles/LoginPaciente.css'; 

const CadastroAdmin = () => {
  const navigate = useNavigate(); 

  const handleRegister = (e) => {
    e.preventDefault();

    navigate('/admin-dashboard');
  };

  return (
    <Container className="d-flex align-items-center justify-content-center vh-100">
      <div className="container" id="container">
        
        <div className="form-container sign-up">
          <Form onSubmit={handleRegister}>
            <h1>Criar Conta</h1>
            <Form.Group controlId="formNome">
              <Form.Control type="text" placeholder="Nome" required />
            </Form.Group>
            <Form.Group controlId="formId">
              <Form.Control type="text" placeholder="ID" required />
            </Form.Group>
            <Form.Group controlId="formCpf">
              <Form.Control type="text" placeholder="CPF" required />
            </Form.Group>
            <Form.Group controlId="formContato">
              <Form.Control type="tel" placeholder="Contato" required />
            </Form.Group>
            <Form.Group controlId="formEmail">
              <Form.Control type="email" placeholder="E-mail" required />
            </Form.Group>
            <Button variant="primary" type="submit">
              Criar Conta
            </Button>
          </Form>
        </div>
      </div>
    </Container>
  );
};

export default CadastroAdmin;
